import styled from 'styled-components';

export const LinkingWrapper = styled.div`
  
ul {
    list-style-type:none;
    display: flex;
    align-items: center;
    justify-content: center;
}
li {
    display: flex;
    position: relative;
    font-size: 12px;
    margin-left: 20px;
  
    a {
        text-decoration: none;
        color: black;
    }
}
  
`
